import React from 'react';

function Colors() {
  var num = 5000;
  return (
    <>
      <h1>
      {
        num = Math.floor(Math.random()*16777215).toString(16)
      }
      </h1>
      <div className="colors-panel"></div>
    </>
  );
}

export { Colors };
